import axios from "axios";

export class ProductService{
    private static serviceUrl:string | undefined = process.env.REACT_APP_PRODUCT_API_URL;


    public static getAllProducts(){
        return axios.get(`${this.serviceUrl}/asdasd`);
    }
}
